  \"modflow-nwt-model-used-to-evaluate-groundwater-surface-water-interactions-in-the-bad-river-wate\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A groundwater-flow model was developed
  for the Bad River Watershed and surrounding area by using the U.S. Geological Survey
  (USGS) finite-difference code MODFLOWu00e2u0080u0093NWT. The model simulates steady-state
  groundwater-flow and base flow in streams by using the streamflow routing (SFR)
  package. The model was calibrated to groundwater levels and base flows obtained
  from the USGS National Water Information System (NWIS) database, and groundwater
  levels obtained from the Wisconsin Department of Natural Resources and Bad River
  Band well-construction databases. Calibration was performed via nonlinear regression
  by using the parameter-estimation software suite PEST.\",\n\t\"license_title\":
